import axios from 'axios'
import React, { useEffect, useState } from 'react'


const SignIn = () => {

    const [users, setusers] = useState([])

    useEffect(() => {

        axios.get('http://localhost:5000/user')
            .then((res) => {
                setusers(res.data)

            })
            .catch((err) => console.log(err))

    }, [])



    const viewImage = users.length > 0 ? <img src={`http://localhost:5000/uploads\\userAvatar\\iStock-1170073827-1260x840.jpg` + users[0].avatar} alt={users[0]._id} /> : null


    return (
        <div>
            <h1>hello in sign in</h1>
            {
                <img src={`http://localhost:5000/uploads/userAvatar/iStock-1170073827-1260x840.jpg`} alt={users[0]._id} />
            }

        </div>
    )
}

export default SignIn
